import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import TabPanel from './Course-TabPanel';
import AboutPanel from './Course-About'
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },

}));

export default function CenteredTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Grid container spacing={1}>
    <Grid item sm={8} xs={12}>
    <Tabs
        value={value}
        onChange={handleChange}
        indicatorColor="primary"
        textColor="primary"
        centered = {false}
      >
        <Tab label="Açıklama" />
        <Tab label="Proje" />
        <Tab label="Yorumlar" />
      </Tabs>
    </Grid>
    <Grid item sm={4} xs={12}>
        <Button style={{top: '15%'}}variant="contained" color="secondary" className={classes.button}>
        Şimdi Kayıt Ol
        </Button>
    </Grid>
    <AboutPanel value={value} index={0}>
        <Typography variant="h6" component="h1">
            <Box fontWeight="Font">Python ile Veri Bilimi ve Makine Öğrenimi</Box>

        </Typography>
    </AboutPanel>
    <TabPanel value={value} index={1}>
        Item Two
    </TabPanel>
    <TabPanel value={value} index={2}>
        Item Three
    </TabPanel>
    </Grid>
  );
}
